import logo from './logo.svg';
import './App.css';
import {
  ComposableMap,
  Geographies,
  Geography,
  Marker,
  ZoomableGroup,
} from "react-simple-maps";import React from 'react';
import ReactDOM from 'react-dom';
import {geoMiller } from "d3-geo";

const geoUrl =
  "https://raw.githubusercontent.com/zcreativelabs/react-simple-maps/master/topojson-maps/world-110m.json";


const App = () => (  
  <div>
    <ComposableMap 
      width="1200" 
      style={{ width: "100%"}} 
      data-tip="" 
      projectionConfig={{ scale: 200 }} >

      <Geographies geography={geoUrl}>
        {({ geographies, projection }) =>
          geographies.map(geo => <Geography 
                                    key={geo.rsmKey} 
                                    geography={geo} 
                                    projection={geoMiller}
                                    style={{
                                      default: {
                                        fill: "#ECEFF1",
                                        stroke: "#607D8B",
                                        strokeWidth: 0.75,
                                        outline: "none"
                                      },
                                      hover: {
                                        fill: "#CFD8DC",
                                        stroke: "#607D8B",
                                        strokeWidth: 1,
                                        outline: "none"
                                      },
                                      pressed: {
                                        fill: "#FF5722",
                                        stroke: "#607D8B",
                                        strokeWidth: 1,
                                        outline: "none"
                                      }
                                    }}
                                    />)
        }
      </Geographies>
    </ComposableMap>
  </div>
);

export default App;
